import React from "react";

const ColorOutput = ({ colors }) => {
    return (
       <div>
            <div className="flex flex-row justify-around w-full">{colors.map((e) => (
                <div style={{backgroundColor: e}} className="w-1/6">{e}</div>
                 )) }
            </div>
            <div>{colors.map((item) => (
                <div>{item}</div>
            ))}</div>
        </div>
    )
}

export default ColorOutput;
